import React from "react";

function Player(props) {
  return (
    <div className="c-player">
      <audio src={props.song.src} controls></audio>
      <h4>Playing Now</h4>
      <p>
        <strong>Next up: </strong>
        {props.nextSong.title} by {props.nextSong.artist}
      </p>
    </div>
  );
}

export default Player;
